void randomSet(Set* s) {
    Set t;
    int n = rand() % maximum_set_size + 1;
    int i;

    createEmptySet(&t);
    for (i = 0; i < n; i += 1) {
        insertSet(&t, rand() % maximum_set_size);
    }
    assignSet(s, &t);
    destroySet(&t);
}

void showOutput(const char* str, Set* set) {
    printf("%s", str);
    displaySet(set);
    printf("\n");
}

typedef void (*setFun)(Set*, const Set*);
void checkCase(setFun fun, Set* s1, Set* s2, Set* expect) {
    Set res;
    createCopySet(&res, s1);
    (*fun)(&res, s2);
	if (showDeets) {showOutput("", &res);}
    assert(isEqualToSet(&res, expect));
    destroySet(&res);
}

void lotsOfTests(void) {
	printf("-- Beginning random union/intxn/sub tests --\n");
    Set a;
    Set b;
    Set onion;
    Set intersection;
    Set difference;

    for (int j = 0; j < number_of_tests; j++) {
        createEmptySet(&a); 
        createEmptySet(&b);
        createEmptySet(&onion);
        createEmptySet(&intersection);
        createEmptySet(&difference);
        
        for (int i = 0; i < 50; i++) {
            insertSet(&a, setResults[j].a[i]);
            insertSet(&b, setResults[j].b[i]);
        }

        for (int i = 0; i < setResults[j].uLen; i++) {
            insertSet(&onion, setResults[j].onion[i]);
        }

        for (int i = 0; i < setResults[j].iLen; i++) {
            insertSet(&intersection, setResults[j].intersection[i]);
        }

        for (int i = 0; i < setResults[j].dLen; i++) {
            insertSet(&difference, setResults[j].difference[i]);
        }

		if (showDeets) {
			printf("*Case #%d*\n", j);
			showOutput("set A: ", &a);
			showOutput("set B: ", &a);

			showOutput("\nexpected sub: ", &difference);
			printf("calculated sub: ");
			checkCase(&subtractFromSet, &a, &b, &difference);

			showOutput("\nexpected union: ", &onion);
			printf("calculated union: ");
			checkCase(&unionInSet, &a, &b, &onion);

			showOutput("\nexpected intxn: ", &intersection);
			printf("calculated intxn: ");
			checkCase(&intersectFromSet, &a, &b, &intersection);

			printf("\n");
		}

		else {
			checkCase(&subtractFromSet, &a, &b, &difference);
			checkCase(&unionInSet, &a, &b, &onion);
			checkCase(&intersectFromSet, &a, &b, &intersection);
		}

        destroySet(&a);
        destroySet(&b);
        destroySet(&onion);
        destroySet(&intersection);    
        destroySet(&difference);
    }

    printf("The random union/intxn/sub tests have been passed\n\n");    
}

