void negativeVisualTests() {
	printf("-- Beginning visualTests (with negative numbers) --\n");
    Set s;
    Set t;
    int i;
    createEmptySet(&s);
    showOutput("The set constructed with the default constructor: ", &s);

    for (i = -50; i < 50; i += 1) {
        insertSet(&s, i);
    }
    showOutput("The set should be {-50, ..., 49}:  ", &s);

    // test Insert() and Contains() with '<<'
    for (i = -50; i < 50; i += 1) {
        insertSet(&s, i);
    }
    showOutput("The set should be {-50, ..., 49}:  ", &s);

    createCopySet(&t, &s);
    showOutput("The copy of s constructed with the copy constructor = ", &t);

    randomSet(&t);
    showOutput("The random set generated equals = ", &t);

    printf("The negative visual tests are over\n\n");
    destroySet(&s);
    destroySet(&t);
}

void isMemberTest(void) {
	printf("-- Beginning isMember tests --\n");
	Set s;

	for (int j = 0; j < number_of_tests; j++) {
		createEmptySet(&s);

		assert(isMemberSet(&s, 0) == 0);

		for (int i = 0; i < 50; i++) {
			insertSet(&s, setResults[j].a[i]);
		}

		if (showDeets) {
			printf("Case #%d\nFormat: search# expected/actual. 0 = not member, 1 = yes \n", j);

			for (int i = -100; i < 100; i++) {
				printf("%d %d/%d. ", i, setResults[j].isInA[i+100], isMemberSet(&s, i));
				assert(isMemberSet(&s, i) == setResults[j].isInA[i+100]);
			}
			printf("\n\n");
		}
		
		else {
			for (int i = -100; i < 100; i++) {
				assert(isMemberSet(&s, i) == setResults[j].isInA[i+100]);
			}
		}

		destroySet(&s);
	}

	printf("The isMember tests have been passed\n\n");
}